const initialState = {
    initialFriends: [
        {name: "Keerat"},
        {name: "Ishaan"},
        {name: "Harmeen"}
    ]
};

const friendReducer = (state = initialState, action) => {
    if (action.type === 'ADD_FRIEND'){
        console.log('add friend', )
    }

    return state;
}

export default friendReducer
